import { StyleSheet, Dimensions } from "react-native";

const styles = StyleSheet.create({
  container: {
    margin: 20,
  },
  textInput: {
    marginTop: 100,
    fontSize: 20,
    marginBottom: 20,
  },

  row: {
    flexDirection: "row",
    alignItems: "center",
    paddingVertical: 15,
    borderBottomWidth: 1,
    borderColor: "grey",
  },
  iconContainer: {
    backgroundColor: "#d4d4d4",
    padding: 7,
    borderRadius: 10,
    marginRight: 15,
  },
  locationText: {},
});

export default styles;
